import Images from "./navigation/image";
import "./secondpage.css";
import sideimg from '../images/int1.jpg'
import Paragraph from "./navigation/para-text";

function ContactSection(){
    const contact_details=
    "Contact Information"+ <br></br> +"47b Great Marlborough Street,"+ <br></br> +"London, W1F 7JP  +44 (0)20 3988 3329reservations@sucrerestaurant.comView our Events Brochure @sucre.london"
    return(
        <>
        <div className={`boxy-area  ${'about-section'}`}>
        <Images imagename={sideimg} class="lefty"></Images>
        <Paragraph side="left-side"
        content={contact_details}></Paragraph>
        </div>
       
        </>
    )
}
export default ContactSection;
